import { Fragment } from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom'
import pageHeader from './components/pageHeader';

function App() {
  return (
    <Fragment>
        <Routes>
          <Route path='/' element={<pageHeader />}>
            <Route path='historico' element={
              <div className='contenedor'>
              </div>
            } />
            <Route path='/' element={
              <div className='contenedor'>
              </div>
            } />
          </Route>
        </Routes>
    </Fragment>
  );
}

export default App;
